export function add26(a: number, b: number): number {
  return a + b;
}

export function subtract26(a: number, b: number): number {
  return a - b;
}

export function multiply26(a: number, b: number): number {
  return a * b;
}

export function divide26(a: number, b: number): number {
  return a / b;
}
